How do you convert a list of json objects to a list of javascript objects?<p>I am currently running into a problem while developing a small web app. I want to send a query to my API from my react front end to ask for a list of "devices" from my MongoDB database. My API endpoint correctly gets that data from the database. However, when I send it back to the front end I run into a problem where I just have a list of "[Object object]"'s and I don't know how to convert this to a list of javascript objects that I can use to render each object in the list into a react component. Anyone know how I can do this?</p>

<p>I've tried to use a variety of combinations of json.parse and json.stringify but I still cant figure out how to properly get these results into a react component.</p>

<p>My API endpoint:</p>

<pre><code>app.get("/api/getdeviceinfo", function(req, res) {
  let token = req.cookies.token;
  let decoded = jwt.decode(token);
  let email = decoded.email;
  let devices = DeviceInfo.find({}).exec(function(err, results) {
    if (err) {
      res.send("an error has occured");
    } else {
      console.log(results);
      res.json(results);
    }
  });
});
</code></pre>

<p>A clip from my frontend:</p>

<pre><code>class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {
      deviceInfo: []
    };
  }

  componentDidMount() {
    fetch("/api/getdeviceinfo", {
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    })
      .then(res =&gt; res.json())
      .then(data =&gt; {
        let info = JSON.stringify(data);
        let infoData = JSON.parse(info);
      })
      .catch(err =&gt; {
        console.error(err);
        alert("Error logging out\n" + err);
      });
  }
</code></pre>

<p>I would like to have this json list of results from my database be a list of javascript objects but instead I have a list of [Object object]'s.</p>

<p>Update:</p>

<p>When I use the following code the resulting alert displays [object Object], [object Object], [object Object], [object Object], [object Object]:</p>

<pre><code>componentDidMount() {
    fetch("/api/getdeviceinfo", {
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    })
      .then(res =&gt; res.json())
      .then(data =&gt; {
        alert(data);
      })
      .catch(err =&gt; {
        console.error(err);
        alert("Error logging out\n" + err);
      });
  }
</code></pre>

<p>This is the correct number of items in the list. But how do I get the attributes from each object?</p>

