  "attibutes" : [  { "key" : "age", "value" : 20 } ]
}

/* 4 */
{ "name" : "dan",
  "attibutes" : []
}

/* 5 */
{ "name" : "el",
  "attibutes" : [ 
        { "key" : "marks", "value" : 5}, 
        { "key" : "age", "value" : 5}
    ]
}
</code></pre>

<p>My use case is I need to <strong>filter</strong> the documents on <strong>marks</strong> and <strong>sort</strong> on <strong>age</strong>. Not all my documents have the necessary data.
I expect the documents not having marks not present in the output, but expect even though a document does not have value for age the document appear in the output.</p>

<p>Query 1: just filter on marks, works as expected, returns two documents</p>

<pre><code>db.getCollection('students').aggregate([
{
  $match: {
    attributes: { 
      $elemMatch: {
        value: {$gte:10},
        key:"marks"
      }
    }
    }
  }
]) 
</code></pre>

<p>returns documents corresponding to Alice and Bob. <strong>EXPECTED</strong></p>

<p>now adding sorting, which I am doing by unwinding, the query looks like</p>

<pre><code>db.getCollection('students').aggregate([  
  {  
    $match:{  
      attributes:{  
        $elemMatch:{  
          value:{  
            $gte:10
          },
          key:"marks"
        }
      }
    }
  },
  {  $addFields:{ attributes_unwind:"$attributes" } },
  {  $unwind:"$attributes_unwind" }, //UNWIND OPERATION
  {  $match:{  "attributes_unwind.key":"age" } },
  {  $sort:{  "attributes_unwind.value":1 } },
  {  $project:{    "attributes_unwind":false } }
])
</code></pre>

<p>this query because of the unwind + match + sort removes the document corresponding to bob which does not have an entry for <strong>age</strong>.</p>

<p>I want to bypass this problem by adding a key value for age (sort attribute) before the line marked //UNWIND OPERATION. This insertion should be conditional only when the original list does not have a key for age. </p>

<p>What I have so far is </p>

<pre><code>db.getCollection('students').aggregate([
{
    $match: {
attributes: { 
                    $elemMatch: {
                        value: {$gte:10},
                        key:"marks"
                        }
                    }
    }
},
{ $addFields: { attributes_unwind: "$attributes" } },
{ $addFields: 
    { attributes_unwind: 
        { $cond :
            [
            {
                attributes_unwind :{ $elemMatch:{key:"age"}}
            },
            "$attributes_unwind",
            { $concatArrays: [ "$attributes_unwind", [ {"key":"age","value":""}] ] } 
            ]
        }
    }
},
{ $unwind: "$attributes_unwind" },
{ $match: {"attributes_unwind.key": "age"}},
{ $sort: {"attributes_unwind.value": 1}},
{ $project: {"attributes_unwind": false}}
 ])
</code></pre>

<p>But if gives an error </p>

<pre><code>Error: command failed: {
    "ok" : 0,
    "errmsg" : "Unrecognized expression '$elemMatch'",
    "code" : 168,
    "codeName" : "InvalidPipelineOperator"
} : aggregate failed 
</code></pre>

